import './App.css';
import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import eventlog from './components/eventlog';

function App() {
  return (
    <Router>
      <Route path ="/" exact component={eventlog}/>
    </Router>

  );
}

export default App;
